import React from 'react';

export default function Contact() {
  return (
    <div className="page-container">
      <h2>Contact Us</h2>
      <p>
        We'd love to hear from you! Whether you have feedback, suggestions, or need help, feel free to reach out.
      </p>
      <p>Email: <a href="mailto:support@livecricketscores.com">support@livecricketscores.com</a></p>
      <p>Business Hours: Monday to Friday, 9:00 AM to 6:00 PM IST</p>
      <p>Follow us on social media for updates and news.</p>
    </div>
  );
}
